const logIn = loggedUser => {
    return { 
        type : 'LOG IN',
        payload : loggedUser
    }
}

const register = loggedUser => {
    return { 
        type : 'REGISTER',
        payload : loggedUser
    }
}

const logOut = () => {
    return { 
        type : 'LOG OUT',
        payload : null
    }
}

export { logIn, register, logOut }
